import { Form, FormGroup, FormLabel, FormControl, FormText, Button } from "react-bootstrap";
import Layout from '../components/layout';
import React from "react";


class Register extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            username: '',
            password: '',
            retypePassword: ''
        }
    }

    handleInputChange = (event) => {
        this.setState({
            [event.target.name]: event.target.value
        })
    }

    render() {
        return (
        <Layout>
            {(parent) => 
                <div className="mt-5">
                    <Form className="container card card-body col-md-6 m-auto pb-3 d-flex flex-column">
                        <h1>Register</h1> 
                        <FormGroup controlId="formEmail">
                            <FormLabel>Email Address</FormLabel>
                            <FormControl type="email" placeholder="Email"/>
                            <FormText className="text-muted">We will never share your email.</FormText>
                        </FormGroup>
                        <FormGroup controlId="formPassword">
                            <FormLabel>Password</FormLabel>
                            <FormControl type="password" name="password" placeholder="Password"/>
                        </FormGroup>
                        <FormGroup controlId="formPassword">
                            <FormLabel>Retype Password</FormLabel>
                            <FormControl type="password" placeholder="Retype Password"/>
                        </FormGroup>
                        <Button variant="outline-info" type="submit">Register</Button>
                    </Form>
                </div>
            }
        </Layout>
        )
    }

}

export default Register;
